-- ----------------------------
DROP TABLE IF EXISTS `testrecord`;
CREATE TABLE `testrecord` (
  `id` bigint(15) NOT NULL COMMENT '唯一标识',
  `userId` bigint(15) NOT NULL COMMENT '用户id',
  `documentId` bigint(15) NOT NULL COMMENT '测试用例文档id',
